import "../index.css"

export class Q2 extends Component {
    render() {
        return (
            <div style={{ padding: "15px" }}>
                <h1 style={{ padding: "15px", fontSize: "30px", color: "darkred" }}>Q2: Level 100: </h1>
                <h4 style={{ fontweight: "bold", fontSize: "20px" }}>1.	Remove duplicates from an unsorted list (12,11,12,21,41,43,21)</h4>
                <pre class="brush: python">
                <code> 
                    array = [12, 11, 12, 21, 41, 43, 21]
             sdf
             </code>
            </pre>

            </div>
        )
    }
}

export default Q2
